import React from 'react';
import styled from 'styled-components';
import { Stickyroll, useStickyroll } from '@stickyroll/stickyroll';
// import './App.css';
import SlideOne from './slides/SlideOne';
import SlideTwo from './slides/SlideTwo';
import SlideThree from './slides/SlideThree';
import SlideFour from './slides/SlideFour';
import SlideFive from './slides/SlideFive';
import SlideSix from './slides/SlideSix';

const StyledApp = styled.div`
  max-height: 100vh;
  overflow-y: scroll;
  scroll-snap-type: y mandatory;
`;

function App() {
  const slides = [
    <SlideOne />,
    <SlideTwo />,
    <SlideThree />,
    <SlideFour />,
    <SlideFive />,
    <SlideSix />,
  ]

  const [
    wrapper, 
    { 
      height, 
      currentPage, 
      pageCount, 
      pageIndex, 
      progress 
    }
  ] = useStickyroll({ pages: slides });

  return (
    <StyledApp className="App">
      {/* <Stickyroll pages={slides} factor={1}> 
        {(props) => {
          const {page, pageIndex, progress} = props;
