          return slides[pageIndex];
        }}
      </Stickyroll> */}
      <SlideOne />
      <SlideTwo />
      <SlideThree />
      <SlideFour />
      <SlideFive />
      <SlideSix />
    </StyledApp>
  );
}

export default App;
